import React from 'react';
import { Link } from 'react-router-dom'; 
import './Register.css'

function Register(){
    return (
            <section className="register">
                <div className="register_top">
                <p className="register_header-title">Добро пожаловать!</p>
                    </div>
                
            </section>
                
            
      );
}

export default Register;
